import React from 'react';
import { NavLink } from 'react-router-dom';
import './checkRegister.css'

const CheckRegister = () => {
    return (
        <div>
            <div className='box'>
                <h1 className='title_register'>GR</h1>
                <p>saduasdyhi</p>
                <button className='button-white'><NavLink to='/login'>Iniciar</NavLink></button>
            </div>
        </div>
    );
};

export default CheckRegister;
